import React from 'react';
import './Circles.css';

const Circles = (props) => {
  return (
  <div className='Circles'>
    {props.circles.map((circle, idx) =>
      <div key={idx + 1}> {circle}</div> 
    )}
  </div>
  );
    };

export default Circles;
